import React from 'react';

let user = {name:"Marat",lastName: "Aripov"}
let callTime=() => new Date().toLocaleTimeString();
setInterval(callTime,10000);
function App() {

  return (
    <div>
      <h1>Help Seytech</h1>
      <h3>{callTime()} Home Work</h3>
      <hr/>
    </div>
  );
}

export default App;
